import React , {useEffect, useState} from 'react';
import DatePicker from 'react-datepicker';
import Axios from 'axios';
import {ManagerNavBar} from "../components/ManagerNavBar";
import "react-datepicker/dist/react-datepicker.css";

export const Pending = ()=> {

    //Required initialization
    const [pending, setPending] = useState([]); 
    const [availExeList, setAvailExeList] = useState([]); 
    const [exeId, setexeId] = useState(0);
    const [vehId, setVehId] = useState(0);
    const [td_date, set_td_date] = useState(null);
    const [td_slot, set_td_slot] = useState('');
    const [vehAvailStatus, setVehAvailStatus] = useState('');

    
    //required methods

    const showPending = ()=>{
        Axios.get("http://localhost:3005/viewPending" ).then((response)=> {
            setPending(response.data);
            console.log(response);
        });
    };

    const Confirm = (id)=>{
        if(exeId.length > 0){
        Axios.put("http://localhost:3005/confirm", 
        { tid : id,
          eid : exeId
        }).then((response)=> {
            alert("confirmed successfully");
            }
        );
        }
        else{
        alert("Invalid data");
        }
    };

    const availExe = ()=>{
        if(td_date.length > 0 && td_slot.length > 0){    
            Axios.post("http://localhost:3005/availExe",{
                date : td_date,
                slot : td_slot
            }).then((response)=> {
                setAvailExeList(response.data);
                console.log(response);
            });
        }
        else{
            alert("Select required fields")
        }
    };

    const vehAvailCheck = ()=>{
        Axios.post("http://localhost:3005/vehAvailable",{
            id : vehId,
            date : td_date,
            slot : td_slot
        }).then((response)=> {
            setVehAvailStatus(response.data[0].status);
            console.log(response);
        });
    };

    //Render page content
    return (
        <div>
            <h1>Manager</h1>
            {<ManagerNavBar/>}
            <hr></hr>
            <h2>Manage Pending testdrives</h2>
            <div>
                <h3>"Availability Check Parameters"</h3>
                <div>

                    <label>"Date"</label>
                    <input type = "date"  
                    onChange={(event)=> {
                        set_td_date(event.target.value);
                        }}
                    />

                    <label>"Slot(Timmings)"</label>
                    <select
                        value={td_slot}
                        onChange={(event) =>{
                            set_td_slot(event.target.value);
                        }}
                    >
                        <option values = "">select time slot</option>
                        <option values = "10:11">10:00 am: 11:00 am</option>
                        <option values = "11:12">11:00 am: 12:00 pm</option>
                        <option values = "3:4">3:00 pm : 4:00 pm</option>
                        <option values = "4:5">4:00 pm : 5:00 pm</option>
                        <option values = "5:6">5:00 pm : 6:00 pm</option>
                    </select>

                </div>
                <div>
                    <h2>Vehicle Availability</h2>
                    <label>"Vehicle ID"</label>
                        <input 
                            type = "text"
                            onChange = {(event)=> {
                            setVehId(event.target.value);
                        }}
                    />
                    <button onClick = {vehAvailCheck} >Check Vehicle Availability</button>
                    <h2>Vehicle Status: {vehAvailStatus}</h2>
                    <hr></hr>
                    <hr></hr>
                </div>

                <div>
                    <h2>Executive Availability</h2>
                    <button onClick = {availExe} >Show Available Executives</button>
                    {availExeList.map( (val)=> {
                        return <div className='availExe-td'>
                                    <label>Executive ID</label><h2>{val.eid}</h2>
                                    <label>Executive Name</label><h2>{val.exename}</h2>
                                    <label>Executive Mob No</label><h2>{val.exemobno}</h2>
                                    <hr></hr>
                                </div>
                        })}
                    <hr></hr>
                    <hr></hr>
                </div>

                <div>
                <button onClick = {showPending} >Pending Testdrive</button>
                        {pending.map( (val)=> {
                        return <div className='active-td'>
                                    <label>Customer Name</label><h2>{val.name}</h2>
                                    <label>Customer Address</label><h2>{val.addr}</h2>
                                    <label>Customer Mobno</label><h2></h2><h2>{val.mobno}</h2>
                                    <label>Vehicle ID</label><h2>{val.vehid}</h2>
                                    <label>Booking Date</label><h2>{val.td_date.substring(0,10)}</h2>
                                    <label>Time Slot</label><h2>{val.td_slot}</h2>
                                    <label>Executive ID</label>
                                    <input 
                                        type = "text"
                                        onChange = {(event)=> {
                                        setexeId(event.target.value);
                                        }}
                                    />
                                    <button onClick = {()=> {Confirm(val.tid)}} >Confirm Testdrive</button>
                                    <hr></hr>
                                </div>
                        })}
                </div>
            </div>    
        </div>
    );
}
